import React from "react"
import Symbols from "./Symbols"
import './style.css';
import './particles.js'

function Desktop() {
  return (
    <div id="desktop" id="particles-js">
      <div class="Symb">
        <Symbols class="symbols" title= "Spotify" icon= ""/> 
        <Symbols class="symbols" title= "Thoughts.pdf" icon= ""/>
        <Symbols class="symbols" title= "Shop?" icon= ""/>
        <Symbols class="symbols" title= "Work" icon= ""/>
      </div>
      <script src="particles.js"></script>
    </div>
  );
}

export default Desktop;
